import Link from 'next/link'

const Nav = () => (
  <nav>
    <h1>This is the nav bar!</h1>
  </nav>
)

const Index = () => (
  <div>
  <Nav />
  <Link href="/about">
  <a title="About Page"> About Page</a>
  </Link>
  <p> Hello Next.js</p>
  </div>
);

export default Index;
